To perform case-sensitive sorting in JavaScript, a simple approach is to use the `localeCompare()` method or the `sort()` method with a custom comparison function. Here are a few examples:

**Using `localeCompare()`**
```javascript
const arr = ['Apple', 'apple', 'Banana', 'banana'];
arr.sort((a, b) => a.localeCompare(b));
console.log(arr); // Output: ["Apple", "Banana", "apple", "banana"]
```
**Using `sort()` with a custom comparison function**
```javascript
const arr = ['Apple', 'apple', 'Banana', 'banana'];
arr.sort((a, b) => {
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
});
console.log(arr); // Output: ["Apple", "Banana", "apple", "banana"]
```
**Using `Intl.Collator` (ECMAScript 2015+)**
```javascript
const arr = ['Apple', 'apple', 'Banana', 'banana'];
const collator = new Intl.Collator('en', { sensitivity: 'variant' });
arr.sort(collator.compare);
console.log(arr); // Output: ["Apple", "Banana", "apple", "banana"]
```
