public class LongestSubArraySumLessThanK {
    public static int longestSubArraySumLessThanK(int[] a, int k) {
        if (a == null || a.length == 0) {
            return 0;
        }

        int maxLength = 0;
        int currentSum = 0;
        int windowStart = 0;

        for (int windowEnd = 0; windowEnd < a.length; windowEnd++) {
            currentSum += a[windowEnd];

            while (currentSum > k && windowStart <= windowEnd) {
                currentSum -= a[windowStart];
                windowStart++;
            }

            maxLength = Math.max(maxLength, windowEnd - windowStart + 1);
        }

        return maxLength;
    }

    public static void main(String[] args) {
        int[] a = {1, 2, 3, 4, 5};
        int k = 7;
        System.out.println("Length of the longest sub-array with sum less than or equal to " + k + ": " + longestSubArraySumLessThanK(a, k));
    }
}
```

