 I'm trying to find a way to close the previously opened Tooltip when a new one is opened.

Here is my code:

\begin{code}
import React, from 'react';
import ReactDOM from 'react-dom';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = ({ children }) => {
  const { openTooltip, closeTooltip } = React.useContext(TooltipContext);

  const handleMouseOver = () => {
    openTooltip(children);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {children}
    </div>
  );
};

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip>Tooltip 1</Tooltip>
      <Tooltip>Tooltip 2</Tooltip>
    </TooltipProvider>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
\end{code}

The problem is that the TooltipProvider is not wrapping the entire application, it's only wrapping the part of the application where the Tooltip is used. So, when a new Tooltip is opened, the previously opened one is not closed.

I'm looking for a way to close the previously opened Tooltip when a new one is opened, without having to wrap the entire application with the TooltipProvider.

Is there a way to achieve this?

Answer: Yes, you can achieve this by using a different approach. Instead of using a context to manage the tooltips, you can use a singleton pattern to manage the tooltips. Here's an example of how you can implement it:

\begin{code}
import React from 'react';
import ReactDOM from 'react-dom';

class TooltipManager {
  static instance = new TooltipManager();

  tooltips = [];

  openTooltip(tooltip) {
    this.closeAllTooltips();
    this.tooltips.push(tooltip);
  }

  closeTooltip(tooltip) {
    const index = this.tooltips.indexOf(tooltip);
    if (index !== -1) {
      this.tooltips.splice(index, 1);
    }
  }

  closeAllTooltips() {
    this.tooltips = [];
  }
}

const Tooltip = ({ children }) => {
  const handleMouseOver = () => {
    TooltipManager.instance.openTooltip(children);
  };

  const handleMouseOut = () => {
    TooltipManager.instance.closeTooltip(children);
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {children}
    </div>
  );
};

const App = () => {
  return (
    <React.Fragment>
      <Tooltip>Tooltip 1</Tooltip>
      <Tooltip>Tooltip 2</Tooltip>
    </React.Fragment>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
\`

In this example, we create a `TooltipManager` class that manages the tooltips. We use a singleton pattern to ensure that there's only one instance of the `TooltipManager` class. We then use this instance to manage the tooltips.

When a tooltip is opened, we close all previously opened tooltips and add the new tooltip to the list. When a tooltip is closed, we remove it from the list.

This approach allows us to manage the tooltips without having to wrap the entire application with a context provider.

